import * as React from 'react';
import Box from '@mui/material/Box';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';

export default function BasicSelect() {
const [filter, setFilters] = React.useState('');

const handleChange = (event) => {
    setFilters(event.target.value);
};
    const filters=[
    {type:'Applied',numbers:1745},
    {type:'Shortlisted',numbers:453},
    {type:'Technical Interview'},
    'Opportunity Browsing',
    'Video Interview I',
    'Video Interview II',
    'Video Interview III',
    'Offer',
    'Withdrawn'
]

return (
    <Box sx={{ minWidth: '100%' }}>
    <FormControl fullWidth>
        <InputLabel id="demo-simple-select-label">Opportunity Browsing</InputLabel>
        <Select
        labelId="demo-simple-select-label"
        id="demo-simple-select"
        value={filter}
        label="Opportunity Browsing"
        onChange={handleChange}
        >
        {filters.map(filter => {
        return <MenuItem className='' value={`${filter}`} >{ filter}</MenuItem>
        })}
        </Select>
    </FormControl>
    </Box>
);
}
